import { Container } from "./styles";

import api from '../../Services/api'

interface IEvents{
  title: string
  date: string
  local: string
}

export function TransactionsTable() {
  const [events, setEvents] = useState<I>([])

  useEffect(() =>{
    api.get('events')
      .then(response => setEvents(response.data))
  }, [] )

  return (
    <Container>
      <table>
        <thead>
          <tr>
            <th>TÃ­tulo</th>
            <th>Local</th>
            <th>Data</th>
          </tr>
        </thead>

        <tbody>

            {events.map(evento => (
              <tr>
                <td>{evento.title}</td>
                <td>{evento.local}</td>
                <td>{evento.date}</td>
              </tr>
            ))}
        </tbody>

      </table>
    </Container>
  )
}
